import React from 'react';
import ReactDOM from 'react-dom';
// import './index.css';
import Spinner from './Spinner';
import Timer from './Timer';


class App extends React.Component {
  constructor(props){
    super(props);
  }

  render(){
    return (
      <div>
        <Timer></Timer>
        <Spinner></Spinner>
      </div>
       );

  }
}

ReactDOM.render(<App />, document.querySelector('#root'));
